import React, { Component } from "react";
import Navigation from "./Navigation";
import { Typography, Select } from "@material-ui/core";

class Contact extends Component {
  state = { projectRequest: false, requestedProjects: [] };
  render() {
    let spacer = {
      height: "0",
      width: "100%",
    };
    return (
      <div>
        <Navigation />
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            height: "100vh",
            flexWrap: "wrap",
          }}
        >
          <div>
            <Typography variant="h6" align="center">
              Want to get ahold of me?
            </Typography>
            <div className={spacer}></div>
            <Typography variant="body2" color="textSecondary">
              This form will automatically send an email to an address you can
              reach me, and if you need a response I'll get back to you.
            </Typography>
            <div className={spacer} style={{ height: "10%" }}></div>
            <Select></Select>
          </div>
        </div>
      </div>
    );
  }
}

export default Contact;
